import React from 'react';
import './MainPageStyle.css';
import img from '../Assets/logo.png';
import { MdPerson, MdInsertChart, MdSearch, MdApps } from 'react-icons/md';
import { BsTools } from 'react-icons/bs';
import { VscPerson } from 'react-icons/vsc';

function MainPage(props){
    
    return(
        <div id="container">

            <header className="header blur">
                <div><MdApps fontSize="30px"/></div>

                {/* <div className="containerSearch">
                    <input placeholder="Pesquisar " className="searchBtn" type="text" />
                    <MdSearch className="searchIcon"/>
                </div> */}

                <div><MdPerson className="userIcon"/></div>
            </header>

            <body className="body">
                <div className="containerOptions blur">
                    <div className="option">
                        <VscPerson/>
                    </div>
                    {/* <div className="option">
                        <BsTools className="toolIcon"/>
                    </div>
                    <div className="option">
                        <MdInsertChart/>
                    </div> */}
                </div>
            </body>

          
        </div>
    );
}

export default MainPage;
